import React from 'react';  

const App: React.FC = () => {  
  return (  
    <div className="App">  
      <header className="App-header">  
        <h1>Welcome to My React App</h1>  
      </header>  
      <main>  
        <p>  
          Edit <code>App.tsx</code> and save to reload.  
        </p>  
      </main>  
    </div>  
  );  
}  

export default App;
